window.bookSummaryJSON = "<p><b>\"If you ever wondered how much better Sherlock would be if people could hurl hellfire at each other, well this one is for you.\" (</b><b><i>Starburst Magazine</i></b><b> on </b><b><i>A Study in Brimstone</i></b><b>)</b></p> <p>As they blunder towards doom, Warlock Holmes and Dr. John Watson find themselves inconvenienced by a variety of eldritch beings. Christmas brings a goose that doesn't let being cooked slow it down; they meet an electricity demon, discover why being a redhead is even trickier than one might imagine, and Holmes attempts an Irish accent. And, naturally, Moriarty is hanging around...in some form or other.</p> <p>Performed by Scott McCormick, Eric Messner, Yasmin Tuazon, Michael Glenn, Colleen Delany, Christopher Scheeren, Patrick Bussink, Terence Aselford, Peter Holdway, Bill Gillett, Todd Scofield, Steve Wannall, Marni Penning, Bradley Smith, Ken Jackson, Jillian Levine-Sisson, Nick DePinto, Lolita Horne, Jonathon Church, Matthew Ward, Evan Casey, Duyen Washington, Mort Shelby, Rose Elizabeth Supan, Stephon Walker, Jonathan Feuer, Tia Shearer, Zeke Alton, Michael John Casey, Nanette Savard, Richard Rohan, Alejandro Ruiz.</p>"; 
